	let dispatch=useDispatch();
  return (
<div>
<br/>
<br/>
<br/>
<br/>
<hr/>
<div className="text-center">
<h1>You will get 10 Spaces at a time</h1>
				<button 
					onClick={()=>
					{
					
						
						dispatch(extendTodo(
						));
					}}
				className="btn btn-primary  mx-2"><strong>CLICK HERE FOR NEW SPACES</strong></button>
				
				<hr/></div></div>
  );
}

export default TenTodos;
